Kardiologische Anbindung: Herr Dr. Ruf (Ambulantes Centrum Berlin).
­
Seit Ende 2024 kommt es zu atypischen pektanginösen Beschwerden und Dyspnoe, die seit Anfang 2025 progredient sind. Aktuell kommt es zu konstanten atypischen pektanginösen Beschwerden (Druck, ohne Ausstrahlung, Keine Zunahme durch Belastung, Keine Besserung durch Ruhe) und Dyspnoe (Alltagsaufgaben, NYHA III) mit Schwindel (beim Treppensteigen & orthostatisch). 
Verneint werden Herzrasen, Palpitationen und Synkopen. 

